import React from 'react';
import { DateInput } from './components/DateInput';
import { Favorites } from './components/Favorites';
import { Launches } from './components/Launches';
import './App.scss';

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      startDate: "1979-09-19",
      endDate: "2019-09-19",
      launches: []
    }
  }
  dateCallBack = (start, end) => {
    this.setState({
      startDate: start,
      endDate: end,
    });
    console.log(start, end);
    this.launchListUpdate(start, end);
  }
  launchListUpdate = (start, end) => {
    this.setState({
      launches:  <Launches start={start} end={end} />
    });
  }
  render = () => {
    return (
      <div className="app">
        <h1>Launches</h1>
        <DateInput callBack={this.dateCallBack} />
        {"start: " + this.state.startDate + " end: " + this.state.endDate}
        <Favorites favorites={[]} />
        {this.state.launches}
      </div>
    );
  }
}

export default App;
